    (SELECT CASE WHEN COUNT(*) > 0 THEN 'v' ELSE 'x' END AS bulan FROM tbl_stock_opname SA WHERE bulan = '7' AND SA.id_kode_lokasi =  A.`id_kode_lokasi`) AS `Jul`,
    (SELECT CASE WHEN COUNT(*) > 0 THEN 'v' ELSE 'x' END AS bulan FROM tbl_stock_opname SA WHERE bulan = '8' AND SA.id_kode_lokasi =  A.`id_kode_lokasi`) AS `Agu`,
    (SELECT CASE WHEN COUNT(*) > 0 THEN 'v' ELSE 'x' END AS bulan FROM tbl_stock_opname SA WHERE bulan = '9' AND SA.id_kode_lokasi =  A.`id_kode_lokasi`) AS `Sep`,
    (SELECT CASE WHEN COUNT(*) > 0 THEN 'v' ELSE 'x' END AS bulan FROM tbl_stock_opname SA WHERE bulan = '10' AND SA.id_kode_lokasi =  A.`id_kode_lokasi`) AS `Okt`,
    (SELECT CASE WHEN COUNT(*) > 0 THEN 'v' ELSE 'x' END AS bulan FROM tbl_stock_opname SA WHERE bulan = '11' AND SA.id_kode_lokasi =  A.`id_kode_lokasi`) AS `Nov`,
    (SELECT CASE WHEN COUNT(*) > 0 THEN 'v' ELSE 'x' END AS bulan FROM tbl_stock_opname SA WHERE bulan = '12' AND SA.id_kode_lokasi =  A.`id_kode_lokasi`) AS `Des`
    FROM tbl_stock_opname A
    WHERE tahun = YEAR(CURDATE())
    GROUP BY tahun,id_pengguna,id_kode_lokasi) Q
      RIGHT JOIN tbl_kode_lokasi L ON Q.id_kode_lokasi = L.`id_kode_lokasi`
      WHERE L.kuasa_pengguna != '0001' AND L.kuasa_pengguna != '*'
